SELECT (SUM(sales.qty) FILTER (WHERE stores.city = 'Fremont' AND strftime('%Y', sales.ord_date) = '1993') - SUM(sales.qty) FILTER (WHERE stores.city = 'Portland' AND strftime('%Y', sales.ord_date) = '1993')) / SUM(sales.qty) FILTER (WHERE stores.city = 'Portland' AND strftime('%Y', sales.ord_date) = '1993') * 100 AS percent_difference
FROM sales
INNER JOIN stores ON sales.stor_id = stores.stor_id;

SELECT (COUNT(CASE WHEN b.stars > 3 THEN 1 END) * 100.0 / COUNT(*)) AS percent_wonderful_experience
FROM business b
WHERE b.city = 'Avondale' AND b.state = 'AZ' AND b.active = 'False';

SELECT (COUNT(CASE WHEN p.name LIKE '%blade%' THEN s.salesid END) * 100.0 / COUNT(s.salesid)) AS percentage_of_blades_sold
FROM sales s
JOIN products p ON s.productid = p.productid;

SELECT COUNT(DISTINCT match.venue_id) AS venue_count
FROM match
WHERE match.toss_winner = match.team_2 AND match.match_winner != match.team_2;

SELECT (COUNT(CASE WHEN toss_decide = 'bowl' THEN 1 END) * 100.0 / COUNT(*)) AS percent_bowl_first
FROM match
WHERE match_date BETWEEN '2010-01-01' AND '2016-12-31';

SELECT COUNT(*) AS teenager_machine_op_count 
FROM customers 
WHERE age BETWEEN 13 AND 19 AND occupation = 'Machine-op-inspct';

SELECT (COUNT(CASE WHEN gp.release_year = '2014' AND p.platform_name = 'PS4' THEN 1 END) * 100.0 / COUNT(*)) AS percentage_of_ps4_games_2014
FROM game_platform gp
JOIN platform p ON gp.platform_id = p.id;

SELECT SUM(quantity) AS total_sold
FROM transactionhistory
WHERE productid = '989' AND transactiondate >= '2013-08-01' AND transactiondate < '2013-09-01';

SELECT AVG(purchaseorderheader.totaldue) AS average_cost
FROM purchaseorderheader
WHERE orderdate >= '2012-01-01' AND orderdate < '2012-07-01';

SELECT (COUNT(CASE WHEN e.businessentityid IS NOT NULL THEN 1 END) * 100.0 / COUNT(*)) AS sales_rep_percentage
FROM employee e
LEFT JOIN salesperson s ON e.businessentityid = s.businessentityid;

SELECT SUM(stockedqty) AS total_stocked_quantity
FROM workorder
WHERE locationid = 40;
